import { useState, useEffect } from 'react'
import { Row, Col } from 'antd'

const apiUrl = 'http://localhost:8000/api/cars'

function CardList() {
    const [cars, setCars] = useState([])

    const getAllCars = async () => {
        try {
            const response = await fetch(apiUrl)
            const data = await response.json()
            setCars(data)

        } catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        getAllCars()
    }, [])

    return (
        <div className='cardGeral'>
            {
                cars.map((oneCar) => {
                    return (
                        <div className='card'>
                            <Row gutter={[16, 16]}>
                                <Col span={6}>{oneCar.BRAND}</Col>
                                <Col span={6}>{oneCar.MODEL}</Col>
                                <Col>{oneCar.DEALER}</Col>
                                <Col>{oneCar.MIN_MILEAGE}</Col>
                                <Col>{oneCar.MAX_MILEAGE}</Col>
                            </Row>
                        </div>
                    )
                })
            }
        </div>
    );
}

export default CardList;
